import React from 'react';
import { Box, Container, Typography, Grid, Paper } from '@mui/material';
import './about.css';

const boardMembers = [
  {
    name: 'Jacenta',
    title: 'President',
    introduction: 'Jacenta is the visionary behind Grace of Good Food Ministries...',
    image: process.env.PUBLIC_URL + '/images/five.jpeg',
  },
  {
    name: 'Carol Collett',
    title: 'Vice President',
    introduction: 'Carol Collett brings decades of experience in nonprofit management...',
    image: process.env.PUBLIC_URL + '/images/four.jpeg',
  },
  {
    name: 'Kirk Belmont',
    title: 'Treasurer',
    introduction: 'Kirk Belmont is a seasoned financial expert with a heart for philanthropy...',
    image: process.env.PUBLIC_URL + '/images/three.jpeg',
  },
  {
    name: 'Moses Kayuni',
    title: 'Community Outreach Coordinator',
    introduction: 'Moses Kayuni is a community organizer with a deep understanding...',
    image: process.env.PUBLIC_URL + '/images/two.jpeg',
  },
];

const About = () => {
  return (
    <div className="about-wrapper">
      <Box className="about-hero-container">
        <Box className="about-intro-container">
          <Typography variant="h2" component="h2" className="intro-title">
            Meet the Team
          </Typography>
          <Typography variant="body1" className="intro-description">
            Our dynamic and diverse team consists of a multinational group of volunteers and paid staff...
          </Typography>
        </Box>
      </Box>

      <Container>
        <Grid container spacing={4} className="team-grid">
          {boardMembers.map((member, index) => (
            <Grid item xs={12} sm={6} key={index}>
              <Paper className={`team-card ${index % 2 === 0 ? 'align-left' : 'align-right'}`}>
                <Box className="team-image-container">
                  <img src={member.image} alt={member.name} className="team-image" />
                  <Box className="team-overlay">
                    <Typography variant="h5" component="h3" className="team-name">
                      {member.name}
                    </Typography>
                    <Typography variant="subtitle1" className="team-title">
                      {member.title}
                    </Typography>
                  </Box>
                </Box>
                <Box className="team-content">
                  <Typography variant="body2" className="team-introduction">
                    {member.introduction}
                  </Typography>
                </Box>
              </Paper>
            </Grid>
          ))}
        </Grid>
      </Container>
    </div>
  );
};

export default About;
